function isColliding(thing1, thing2) {
    var isAbove = thing1.height + thing1.y < thing2.y;
    var isBelow = thing2.height + thing2.y < thing1.y;
    var isLeft = thing1.width + thing1.x < thing2.x;
    var isRight = thing2.width + thing2.x < thing1.x;
    if(isAbove || isBelow || isLeft || isRight) {
        return false;
    } else {
        return true;
    }
}

function setFalse(event) {
    var key = event.which;
    if(key == 37 || key == 65) {
        keyLeft = false;
    }
    if(key == 38 || key == 87) {
        keyUp = false;
    }
    if(key == 39 || key == 68) {
        keyRight = false;
    }
    if(key == 40 || key == 83) {
        keyDown = false;
    }
    if(key = 68) {
        displayDead = false;
    }
}

function keyDownHandler(event) {
    var key = event.which;
    if(key == 37 || key == 65) {
        keyLeft = true;
    }
    if(key == 38 || key == 87) {
        keyUp = true;
    }
    if(key == 39 || key == 68) {
        keyRight = true;
    }
    if(key == 40 || key == 83) {
        keyDown = true;
    }
    if(key = 68) {
        displayDead = true;
    }
}
window.addEventListener("keydown", keyDownHandler, true);
window.addEventListener("keyup", setFalse, true);

function moveBall() {
    if(keyLeft === true && player.x > 0) {
        player.x -= 5;
    }
    if(keyUp === true && player.y > 0) {
        player.y -= 5;
    }
    if(keyRight === true && player.x < canvas.width - 25) {
        player.x += 5;
    }
    if(keyDown === true && player.y < canvas.height - 25) {
        player.y += 5;
    }
}
