function Block(x, y, width, height) {
    this.x = x;
    this.y = y;
    this.width = width;
    this.height = height;
    this.draw = function() {
        ctx.strokeRect(this.x, this.y, this.width, this.height);
    };
}

function sandBlock(x, y, width, height) {
    this.x = x;
    this.y = y;
    this.width = width;
    this.height = height;
    this.draw = function() {
        ctx.beginPath();
        ctx.rect(this.x, this.y, this.width, this.height);
        ctx.fillStyle = "#EDC9AF";
        ctx.fill();
    };
}

function endTile(x, y, width, height) {
    this.x = x;
    this.y = y;
    this.width = width;
    this.height = height;
    this.draw = function() {
        ctx.rect(this.x, this.y, this.width, this.height);
        ctx.fillStyle = "blue";
        ctx.fill();
    };
}

function diagonalBlock(x, y, width, height) {
    this.x = x;
    this.y = y;
    this.width = width;
    this.height = height;
    this.movingDiagonal = true;
    this.draw = function() {
        ctx.strokeRect(this.x, this.y, this.height, this.width);
    };
    this.move = function() {
        if(this.movingDiagonal) {
            this.x -= 3;
            this.y -= 3;
        } else {
            this.x += 3;
            this.y += 3;
        }
    };
}

function fakeBlock(x, y, width, height) {
    this.x = x;
    this.y = y;
    this.width = width;
    this.height = height;
    this.draw = function() {
        ctx.beginPath();
        ctx.rect(this.x, this.y, this.width, this.height);
        ctx.fillStyle = "blue";
        ctx.fill();
    };
}

function invisBlock(x, y, width, height) {
    this.x = x;
    this.y = y;
    this.width = width;
    this.height = height;
    this.draw = function() {
        ctx.strokeRect(this.x, this.y, this.width, this.height);
    };
}
