function newMap() {
    blocks = [];
    endTiles = [];
    movingBlocks = [];
    invisBlocks = [];
    sandBlocks = [];
    vertMovingBlocks = [];
    diagonalBlocks = [];
    fakeBlocks = [];
    for(i = 0; i < maps[mapNum].length; i++) {
        for(j = 0; j < maps[mapNum][i].length; j++) {
            if(maps[mapNum][i][j] === 1) {
                blocks.push(new Block(j * 20 + 1, i * 20 + 1, 20, 20));
            }
            if(maps[mapNum][i][j] === 2) {
                movingBlocks.push(new movingBlock(j * 20 + 1, i * 20 + 1, 20, 20));
            }
            if(maps[mapNum][i][j] === 4) {
                vertMovingBlocks.push(new vertMovingBlock(j * 20 + 1, i * 20 + 1, 20, 20));
            }
            if(maps[mapNum][i][j] === 3) {
                endTiles.push(new endTile(j * 20 + 1, i * 20 + 1, 20, 20));
            }
            if(maps[mapNum][i][j] === 5) {
                invisBlocks.push(new invisBlock(j * 20 + 1, i * 20 + 1, 20, 20));
            }
            if(maps[mapNum][i][j] === 6) {
                sandBlocks.push(new sandBlock(j * 20 + 1, i * 20 + 1, 20, 20));
            }
            if(maps[mapNum][i][j] == 7) {
                fakeBlocks.push(new fakeBlock(j * 20 + 1, i * 20 + 1, 20, 20));
            }
            if(maps[mapNum][i][j] == 8) {
                diagonalBlocks.push(new diagonalBlock(j * 20 + 1, i * 20 + 1, 20, 20));
            }
        }
    }
}
newMap();
var player = {
    x: 7,
    y: 7,
    height: 25,
    width: 25,
    draw: function() {
        ctx.beginPath();
        ctx.rect(this.x, this.y, this.height, this.width);
        ctx.fillStyle = "red";
        ctx.fill();
    }
};

function playerIsCollidingWithBlocks() {
    for(i = 0; i < blocks.length; i++) {
        if(isColliding(player, blocks[i]) === true) {
            player.x = 7;
            player.y = 7;
            deathCount++;
        }
    }
    for(i = 0; i < movingBlocks.length; i++) {
        if(isColliding(player, movingBlocks[i]) === true) {
            player.x = 7;
            player.y = 7;
            deathCount++;
        }
    }
    for(i = 0; i < vertMovingBlocks.length; i++) {
        if(isColliding(player, vertMovingBlocks[i]) === true) {
            player.x = 7;
            player.y = 7;
            deathCount++;
        }
    }
    for(i = 0; i < endTiles.length; i++) {
        if(isColliding(player, endTiles[i]) === true) {
            mapNum++;
            player.x = 7;
            player.y = 7;
            newMap();
        }
    }
    for(i = 0; i < sandBlocks.length; i++) {
        if(isColliding(player, sandBlocks[i]) === true) {
            keyUp = false;
            keyDown = false;
            keyLeft = false;
            keyRight = false;
        }
    }
    for(i = 0; i < fakeBlocks.length; i++) {
        if(isColliding(player, fakeBlocks[i]) === true) {
            player.x = 7;
            player.y = 7;
            deathCount++;
        }
    }
}

function movingBlock(x, y, width, height) {
    this.x = x;
    this.y = y;
    this.width = width;
    this.height = height;
    this.movingLeft = true;
    this.draw = function() {
        ctx.strokeRect(this.x, this.y, this.height, this.width);
    };
    this.move = function() {
        if(this.movingLeft) {
            this.x -= 3;
        } else {
            this.x += 3;
        }
    };
}
//Sometimes goes through things

function vertMovingBlock(x, y, width, height) {
    this.x = x;
    this.y = y;
    this.width = width;
    this.height = height;
    this.movingUp = true;
    this.draw = function() {
        ctx.strokeRect(this.x, this.y, this.height, this.width);
    };
    this.move = function() {
        if(this.movingUp) {
            this.y -= 3;
        } else {
            this.y += 3;
        }
    };
}

function changeDiagBlockDirection() {
    for(i = 0; i < diagonalBlocks.length; i++) {
        for(j = 0; j < blocks.length; j++) {
            if(isColliding(diagonalBlocks[i], blocks[j])) {
                diagonalBlocks[i].movingDiagonal = !diagonalBlocks[i].movingDiagonal;
            }
        }
    }
}

function changeMovingBlockDirection() {
    for(i = 0; i < movingBlocks.length; i++) {
        for(j = 0; j < blocks.length; j++) {
            if(isColliding(movingBlocks[i], blocks[j])) {
                movingBlocks[i].movingLeft = !movingBlocks[i].movingLeft;
            }
        }
    }
    //     for(i = 0; i < movingBlocks.length; i++){
    //         for(j = 0; j < invisBlocks.length; j++){
    //             if(isColliding(movingBlock[i], invisBlocks[j])) {
    //                 movingBlocks[i].movingLeft = !movingBlocks[i].movingLeft; 
    //             }
    //         }
    //     }
}

function changeVertBlockDirection() {
    for(i = 0; i < vertMovingBlocks.length; i++) {
        for(j = 0; j < blocks.length; j++) {
            if(isColliding(vertMovingBlocks[i], blocks[j])) {
                vertMovingBlocks[i].movingUp = !vertMovingBlocks[i].movingUp;
            }
        }
    }
}
